import React from 'react';


function Footer() {
  return (
    <footer className="footer">
      <p>&copy; 2025 GrandeurDefined. All rights reserved.</p>
      <i class="bi bi-house-heart"></i>
      <small>Developed by Henny_Blak</small>
    </footer>
  );
}

export default Footer;
